/*Table structure for table `daemon_outgoing_emails` */

DROP TABLE IF EXISTS `daemon_outgoing_emails`;

CREATE TABLE `daemon_outgoing_emails` (
  `id` int(11) NOT NULL auto_increment,
  `senderId` varchar(255) NOT NULL,
  `receiverId` varchar(255) NOT NULL,
  `emailTo` varchar(255) NOT NULL,
  `fromName` varchar(150) NOT NULL,
  `subject` varchar(255) NOT NULL,
  `emailBody` text NOT NULL,
  `status` enum('0','1') NOT NULL default '0' COMMENT '''0'' - not sent, ''1'' - sent',
  `createdAt` datetime NOT NULL,
  PRIMARY KEY  (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=129 DEFAULT CHARSET=latin1;

