/*Table structure for table `daemon_outgoing_sms` */

DROP TABLE IF EXISTS `daemon_outgoing_sms`;

CREATE TABLE `daemon_outgoing_sms` (
  `id` int(11) NOT NULL auto_increment,
  `senderId` int(11) NOT NULL,
  `receiverId` int(11) NOT NULL,
  `smsTo` varchar(15) NOT NULL,
  `subject` varchar(255) NOT NULL,
  `smsBody` text NOT NULL,
  `status` enum('0','1') NOT NULL COMMENT '''0'' - not sent, ''1'' - sent',
  `createdDate` datetime NOT NULL,
  PRIMARY KEY  (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

