/*Table structure for table `login` */

DROP TABLE IF EXISTS `login`;

CREATE TABLE `login` (
  `id` int(11) NOT NULL auto_increment,
  `isVerified` varchar(100) NOT NULL,
  `status` enum('0','1','2') NOT NULL default '1' COMMENT '0 for in active 1 active and 2 for block',
  `smsOk` enum('0','1') NOT NULL default '0' COMMENT '0-no sms send,1-sms send',
  `created` datetime NOT NULL,
  `modified` datetime NOT NULL,
  `loginId` varchar(100) NOT NULL COMMENT 'phone number or email id',
  `loginIdType` enum('0','1') NOT NULL default '0' COMMENT '0-email,1-phone',
  `password` varchar(50) NOT NULL,
  `fpasswordConfirm` varchar(50) NOT NULL,
  `userId` int(11) NOT NULL,
  `expiry` int(11) NOT NULL,
  `last_todoassign` varchar(150) NOT NULL,
  `last_listId` int(11) NOT NULL,
  `last_priority` int(11) NOT NULL,
  `last_duedate` int(11) NOT NULL,
  PRIMARY KEY  (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=234 DEFAULT CHARSET=latin1;

