/*Table structure for table `todo_items` */

DROP TABLE IF EXISTS `todo_items`;

CREATE TABLE `todo_items` (
  `id` bigint(20) NOT NULL auto_increment,
  `listId` bigint(20) NOT NULL,
  `key` varchar(15) NOT NULL,
  `title` varchar(255) NOT NULL,
  `description` text NOT NULL,
  `attachmentIds` varchar(255) NOT NULL,
  `creater` int(11) NOT NULL,
  `assignedBy` bigint(20) NOT NULL,
  `assignTo` int(11) NOT NULL,
  `assignToEmail` varchar(100) NOT NULL,
  `dueDate` date NOT NULL,
  `priority` enum('0','1','2','3') NOT NULL COMMENT '0-low, 1-medium, 2high, 3-urgent',
  `status` enum('1','2','3','4') NOT NULL default '1' COMMENT '1 - Open , 2 - QA , 3 - Resolve , 4 - Close',
  `createdAt` datetime NOT NULL,
  `modifiedAt` datetime NOT NULL,
  `deletedAt` datetime NOT NULL,
  PRIMARY KEY  (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=1770 DEFAULT CHARSET=latin1;

