/*Table structure for table `users` */

DROP TABLE IF EXISTS `users`;

CREATE TABLE `users` (
  `id` bigint(20) NOT NULL auto_increment,
  `firstName` varchar(50) NOT NULL,
  `lastName` varchar(50) NOT NULL,
  `avatar` varchar(255) NOT NULL,
  `linkedinLink` varchar(255) NOT NULL,
  `facebookLink` varchar(255) NOT NULL,
  `twitterLink` varchar(255) NOT NULL,
  `timezone` varchar(255) NOT NULL,
  `myList` int(11) NOT NULL default '0',
  `byMeList` int(11) NOT NULL default '0',
  `otherList` int(11) NOT NULL default '0',
  `myOpenStatus` enum('0','1') NOT NULL default '1' COMMENT '0-display false,1-display true',
  `myDoneStatus` enum('0','3') NOT NULL default '3' COMMENT '0-display false3-display true',
  `myCloseStatus` enum('0','4') NOT NULL default '4' COMMENT '0-display false4-display true',
  `byMeOpenStatus` enum('0','1') NOT NULL default '1' COMMENT '0-display false,1-display true',
  `byMeDoneStatus` enum('0','3') NOT NULL default '3' COMMENT '0-display false3-display true',
  `byMeCloseStatus` enum('0','4') NOT NULL default '4' COMMENT '0-display false4-display true',
  `otherOpenStatus` enum('0','1') NOT NULL default '1' COMMENT '0-display false,1-display true',
  `otherDoneStatus` enum('0','3') NOT NULL default '3' COMMENT '0-display false3-display true',
  `otherCloseStatus` enum('0','4') NOT NULL default '4' COMMENT '0-display false4-display true',
  `createdAt` datetime NOT NULL,
  `modifiedAt` datetime NOT NULL,
  `deletedAt` varchar(15) NOT NULL,
  PRIMARY KEY  (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=140 DEFAULT CHARSET=latin1;

